import React from 'react'
import {NavLink} from "react-router-dom";
import d from "./Dialogs.module.css";


const Dialog = (props) => {

    return <div>
        <div className={d.Main}>
            <div className={d.padding}>
                {props.UserName}
                {props.avatar}
            </div >
            <div className={d.padding}>
                {props.MessageText}
            </div>
            <div className={d.padding}>
                {props.MessageSendTime}
            </div>
        </div>
    </div>
}

export default Dialog;
